> Florida Chaffetz, Webster challenge McCarthy for House speaker FILE - In this April 26, 2011, file photo, Rep. Daniel Webster, R-Fla., center, talks to reporters before addressing a town hall meeting in Orlando, Fla. House Majority Leader Kevin McCarthy is the front-runner in the race to become the next speaker, but he faces two Republican opponents who are trying to draw some of his support. Four-term Rep. Jason Chaffetz of Utah and Webster both say they can bring a needed fresh perspective to GOP leadership, unlike McCarthy, who has served as majority leader under Speaker John Boehner, R-Ohio. (AP Photo/Phelan M. Ebenhack, File) 
